import React, { Component } from 'react';
import { Grid , Cell } from 'react-mdl';
import gmb from '../main-visual.jpg';
import gmb1 from '../Sepedah.jpeg';
import img from './logo.png';

class biodata extends Component{
    render(){
        return(
            <div style={{ width: '100%' , margin: 'auto' }}>

            <Grid className="landing-grid">
            <Cell col={5}>
            <h1 className="text">
            BIKE FIXIE
            <Cell col={12} className="lorem" >dolor sit amet, consectetur adipisicing elit, sed do eiusmod
            tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam,
            quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo
            consequat.</Cell>   

            <Cell col={12} className="harga" >
            <p className="ukuran">$ 899.350</p>
            </Cell>
            </h1>
            </Cell>

            <Cell col={7} className="" ><img src={gmb1} className="logo-sepedah" /></Cell>

            </Grid>


            <Grid>
            <Cell col={4} className="kotak" ><img src={gmb} className="gambar" /></Cell>
            <Cell col={4} className="kotak" ><img src={gmb} className="gambar" /></Cell>
            <Cell col={4} className="kotak" ><img src={gmb} className="gambar" /></Cell>
            </Grid>

            <Grid className="demo-grid-ruler">
            <Cell col={4} className="kotak" ></Cell>
            <Cell col={4} className="kotak" ><img src={gmb} className="gambar" /></Cell>
            <Cell col={4} className="kotak" ><img src={gmb} className="gambar" /></Cell>
            </Grid>

            </div>
            )
        }
    }

    export default biodata;
